const dayjs = require('dayjs');

function timeWorked(input) {
    // const start  = input.employee_clock_in;
    // const end = input.employee_clock_out;
    const start  = "2023-02-21T17:36:19.000Z";
    const end = "2023-02-21T17:37:41.000Z";
    var duration = dayjs.duration(dayjs(start).diff(dayjs(end)));
    console.log(duration);
}

module.exports = {
    timeWorked
}
